import { useForm } from "react-hook-form";
import {Link} from 'react-router-dom';

import arrow from '../../assets/home/icons/grey_arrow-right.svg'
import NoTickets from '../../pages/Purchase/account/NoTickets';
import check from '../../assets/home/icons/check-fill.svg'



export default function ApprovedPassword () {
const form = useForm();
//якщо користувач новий - то лінк на немає квитків(localstorage),інше -  з квитками
    return(
<section className="modal">
    <form>
        <img src={check} alt="password succecfully reset"/>
        <h1>Password Reset</h1>
        <h4> Your password has been successfully reset.
        Click below to login in magically.</h4>
        <Link to='/' element={<Home/>}>
        
        <button className="btn_submit" type="submit">
            Continue
        </button>
        </Link>
        <section className="additionals">
                <Link to="/account" element={<NoTickets/>}>
          <button><img src={arrow} alt="back to login"/> Back to Login</button>
             </Link>
            </section>
    </form>
    
</section>
    )
}
